pragma solidity ^0.4.19;

contract mikochi{

    uint public tt = 0;
    uint public star=0;
    function take()public{
        tt=block.timestamp;
    }
    function di() public{
      star = block.timestamp % 91;
      if(star<=5){
        star=5;}
      else if(star<=14){
        star=4;
      }
      else if(star<=30){
        star=3;
      }
      else if(star<=55){
        star=2;
      }
      else{
        star=1;
      }
    }

}
